import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

const Contact = () => {
    return (
        <section id="#Contact">
            <Navbar />
            <h3>Me contacter:</h3>
            <p>Mail: servant.aurelien.developer@gmail.com</p>
            <p> Tel: 06.66.90.68.67</p>
            <Footer />
        </section>
    )
}

export default Contact;
